@Module
public class NetworkModule {

    public static final String BASE_URL = "BASE_URL";
    private static final String REQUEST_INTERCEPTOR = "requestInterceptor";

    @Provides
    @Singleton
    @Named(REQUEST_INTERCEPTOR)
    public Interceptor provideRequestInterceptor(@ApplicationContext Context context) {
        return new NetworkSessionManager(context);
    }

    @Provides
    @Named(BASE_URL)
    public String provideBaseUrlString() {
        return BuildConfig.BASE_ENDPOINT;
    }

    @Provides
    @Singleton
    public Converter.Factory provideGsonConverter() {
        return GsonConverterFactory.create();
    }

    @Singleton
    @Provides
    public OkHttpClient provideOkHttpClient(@Named(REQUEST_INTERCEPTOR) Interceptor networkSessionManager) {
        final OkHttpClient.Builder builder = new OkHttpClient.Builder();
        if (BuildConfig.RETROFIT_LOG_ALL) {
            HttpLoggingInterceptor logging = new HttpLoggingInterceptor();
            logging.setLevel(HttpLoggingInterceptor.Level.BODY);

            /*add logging as the last interceptor to get all logs https://futurestud.io/tutorials/retrofit-2-log-requests-and-responses*/
            builder.addInterceptor(networkSessionManager);
            builder.addInterceptor(logging);
        }
        return builder.build();
    }

    @Provides
    @Singleton
    public Retrofit provideRetrofit(Converter.Factory converter, OkHttpClient client, @Named(BASE_URL) String baseUrl, MockWebServer ignored) {
        return new Retrofit.Builder()
                .baseUrl(baseUrl)
                .client(client)
                .addCallAdapterFactory(RxJava2CallAdapterFactory.create())
                .addConverterFactory(converter)
                .build();
    }

    @Singleton
    @Provides
    MockWebServer providerMockWebServer() {
        return new MockWebServer();
    }
}
```

